import TextField from '@material-ui/core/TextField';
import { createMuiTheme } from '@material-ui/core/styles';

const styleInput = {
    height: '100px',
    width: '25ch'
};

const Login = () =>{
    return(
        <form style={styleInput}>
             <TextField 
                required
                class="Input"
                label="Outlined secondary"
                defaultValue="YourEmail@mail.com"
                variant="outlined"
                color="primary"
            />
        </form>
    )
}

export default Login;
